function AlphabeticalSort(List) {
	List.sort((a, b) => {
		return (a.name > b.name) ? 1 : -1

	})
	ClearTable()
	List.forEach(Achievement)
}

function TimeSort(List) {
	List.sort((a, b) => {
		return (a.unlocktime < b.unlocktime) ? 1 : -1

	})
	ClearTable()
	List.forEach(Achievement)
}

function ClearTable(Table) {
	Table = document.getElementById("Sheet")
	Table.innerHTML = "<tr> <th> Achievement name</th> <th>✓ or ✗</th> <th>Time achieved (EST)</th> <th>Archived Run</th></tr > "
	Unlocked = 0;
	Total = 0;
}



//AlphabeticalSort(List);
TimeSort(List);

function Achievement(List) {
	var Row = document.createElement("tr")
	var Name = List.name
	var Completion
	var Time
	var Description = List.description



	if (List.achieved == 0) {
		Completion = "✗"
		Total++
		Time = "-"
	}


	if (List.achieved == 1) {
		Completion = "✓"
		Time = new Date(List.unlocktime * 1000)
		Time = Time.toLocaleString()
		Unlocked++
		Total++
	}

	if (List.URL != null) {
		Name = "<a href = " + URL + ">" + Name + "</a>";
	}

	if (List.RunID != null) {
		var URL = runs[List.RunID - 1]
		URL = "<a href = " + URL + ">" + "Archive Run " + (List.RunID) + "</a>";
	}

	else {
		URL = "-"
	}


	Table.append(Row)

	Row.innerHTML = "<td>" + "<b>" + Name + "</b>" + "</br>" + "<i>" + Description + "<i>" + "</td>" + "<td>" + Completion + "</td>" + "<td>" + Time + "</td>" + "<td>" + URL + "</td>"

	//document.body.append(Name)
	//document.body.append(Completion)
	//document.body.append(Time)

	//document.createElement(AchievementName + ", ");
}



